import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import football from './something.png'
import "./navbar.css";





class Navbars extends React.Component{

    render(){
        return(
            <div >
            <div>
                <Navbar collapseOnSelect expand="xl" bg="dark"  >
                    <Navbar.Brand href="/">
                    <img src={football} alt="football" 
                    width="60" height="60"
                    className="d-inline-block align-top"
                    />
                    </Navbar.Brand>
                <Navbar.Brand href="/"><div className="heading">Ancast</div> </Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="mr-auto bar">
                    <Nav.Link href="/login">Login</Nav.Link>
                    <Nav.Link href="/signup">SignUp </Nav.Link>
                    </Nav>
                </Navbar.Collapse>
                </Navbar>
             </div>  
                 {/* <div className="row">
                     <div className="left">
                         <img src="/assets/images/bg1.png" height="1000" width="" alt="bbg11"/>
                     </div> */}

             {/* </div>  */}
             </div>            
        )
      }
    }

export default Navbars;
